                if (term in fullData.docs.extra[i]) {
                    var strength = fullData.docs.extra[i][term] /
                        Object.values(fullData.docs.extra[i]).reduce(
                            function (a, b) {
                                return a + b
                            });
                    var text = fullData.docs.texts[i];
                    if (!useFullDoc)
                        text = text.slice(0, 300);
                    var curMatch = {'id': i, 'snippets': [text], 'strength': strength};

                    curMatch['meta'] = fullData.docs.meta[i];
                    matches[fullData.docs.labels[i]].push(curMatch);
                }
            }
            for (var i in [0, 1]) {
                matches[i] = matches[i].sort(function (a, b) {
                    return a.strength < b.strength ? 1 : -1
                })
            }
            return {'contexts': matches, 'info': d};
        }

        // from https://mathiasbynens.be/notes/es-unicode-property-escapes#emoji
        var emojiRE = (/(?:[\u261D\u26F9\u270A-\u270D]|\uD83C[\uDF85\uDFC2-\uDFC4\uDFC7\uDFCA-\uDFCC]|\uD83D[\uDC42\uDC43\uDC46-\uDC50\uDC66-\uDC69\uDC6E\uDC70-\uDC78\uDC7C\uDC81-\uDC83\uDC85-\uDC87\uDCAA\uDD74\uDD75\uDD7A\uDD90\uDD95\uDD96\uDE45-\uDE47\uDE4B-\uDE4F\uDEA3\uDEB4-\uDEB6\uDEC0\uDECC]|\uD83E[\uDD18-\uDD1C\uDD1E\uDD1F\uDD26\uDD30-\uDD39\uDD3D\uDD3E\uDDD1-\uDDDD])(?:\uD83C[\uDFFB-\uDFFF])?|(?:[\u231A\u231B\u23E9-\u23EC\u23F0\u23F3\u25FD\u25FE\u2614\u2615\u2648-\u2653\u267F\u2693\u26A1\u26AA\u26AB\u26BD\u26BE\u26C4\u26C5\u26CE\u26D4\u26EA\u26F2\u26F3\u26F5\u26FA\u26FD\u2705\u270A\u270B\u2728\u274C\u274E\u2753-\u2755\u2757\u2795-\u2797\u27B0\u27BF\u2B1B\u2B1C\u2B50\u2B55]|\uD83C[\uDC04\uDCCF\uDD8E\uDD91-\uDD9A\uDDE6-\uDDFF\uDE01\uDE1A\uDE2F\uDE32-\uDE36\uDE38-\uDE3A\uDE50\uDE51\uDF00-\uDF20\uDF2D-\uDF35\uDF37-\uDF7C\uDF7E-\uDF93\uDFA0-\uDFCA\uDFCF-\uDFD3\uDFE0-\uDFF0\uDFF4\uDFF8-\uDFFF]|\uD83D[\uDC00-\uDC3E\uDC40\uDC42-\uDCFC\uDCFF-\uDD3D\uDD4B-\uDD4E\uDD50-\uDD67\uDD7A\uDD95\uDD96\uDDA4\uDDFB-\uDE4F\uDE80-\uDEC5\uDECC\uDED0-\uDED2\uDEEB\uDEEC\uDEF4-\uDEF8]|\uD83E[\uDD10-\uDD3A\uDD3C-\uDD3E\uDD40-\uDD45\uDD47-\uDD4C\uDD50-\uDD6B\uDD80-\uDD97\uDDC0\uDDD0-\uDDE6])|(?:[#\*0-9\xA9\xAE\u203C\u2049\u2122\u2139\u2194-\u2199\u21A9\u21AA\u231A\u231B\u2328\u23CF\u23E9-\u23F3\u23F8-\u23FA\u24C2\u25AA\u25AB\u25B6\u25C0\u25FB-\u25FE\u2600-\u2604\u260E\u2611\u2614\u2615\u2618\u261D\u2620\u2622\u2623\u2626\u262A\u262E\u262F\u2638-\u263A\u2640\u2642\u2648-\u2653\u2660\u2663\u2665\u2666\u2668\u267B\u267F\u2692-\u2697\u2699\u269B\u269C\u26A0\u26A1\u26AA\u26AB\u26B0\u26B1\u26BD\u26BE\u26C4\u26C5\u26C8\u26CE\u26CF\u26D1\u26D3\u26D4\u26E9\u26EA\u26F0-\u26F5\u26F7-\u26FA\u26FD\u2702\u2705\u2708-\u270D\u270F\u2712\u2714\u2716\u271D\u2721\u2728\u2733\u2734\u2744\u2747\u274C\u274E\u2753-\u2755\u2757\u2763\u2764\u2795-\u2797\u27A1\u27B0\u27BF\u2934\u2935\u2B05-\u2B07\u2B1B\u2B1C\u2B50\u2B55\u3030\u303D\u3297\u3299]|\uD83C[\uDC04\uDCCF\uDD70\uDD71\uDD7E\uDD7F\uDD8E\uDD91-\uDD9A\uDDE6-\uDDFF\uDE01\uDE02\uDE1A\uDE2F\uDE32-\uDE3A\uDE50\uDE51\uDF00-\uDF21\uDF24-\uDF93\uDF96\uDF97\uDF99-\uDF9B\uDF9E-\uDFF0\uDFF3-\uDFF5\uDFF7-\uDFFF]|\uD83D[\uDC00-\uDCFD\uDCFF-\uDD3D\uDD49-\uDD4E\uDD50-\uDD67\uDD6F\uDD70\uDD73-\uDD7A\uDD87\uDD8A-\uDD8D\uDD90\uDD95\uDD96\uDDA4\uDDA5\uDDA8\uDDB1\uDDB2\uDDBC\uDDC2-\uDDC4\uDDD1-\uDDD3\uDDDC-\uDDDE\uDDE1\uDDE3\uDDE8\uDDEF\uDDF3\uDDFA-\uDE4F\uDE80-\uDEC5\uDECB-\uDED2\uDEE0-\uDEE5\uDEE9\uDEEB\uDEEC\uDEF0\uDEF3-\uDEF8]|\uD83E[\uDD10-\uDD3A\uDD3C-\uDD3E\uDD40-\uDD45\uDD47-\uDD4C\uDD50-\uDD6B\uDD80-\uDD97\uDDC0\uDDD0-\uDDE6])\uFE0F/g);

        function isEmoji(str) {
            if (str.match(emojiRE)) return true;
            return false;
        }

        function searchInText(d) {
            function stripNonWordChars(term) {
                //d.term.replace(" ", "[^\\w]+")
            }

            function removeUnderScoreJoin(term) {
                /*
                '_ _asjdklf_jaksdlf_jaksdfl skld_Jjskld asdfjkl_sjkdlf'
                  ->
                "_ _asjdklf jaksdlf jaksdfl skld Jjskld asdfjkl_sjkdlf"
                 */
                return term.replace(/(\w+)(_)(\w+)/, "$1 $3")
                    .replace(/(\w+)(_)(\w+)/, "$1 $3")
                    .replace(/(\w+)(_)(\w+)/, "$1 $3");
            }

            function buildMatcher(term) {

                var boundary = '\\b';
                var wordSep = "[^\\w]+";
                if (asianMode) {
                    boundary = '( |$|^)';
                    wordSep = ' ';
                }
                if (isEmoji(term)) {
                    boundary = '';
                    wordSep = '';
                }
                var regexp = new RegExp(boundary + '('
                    + removeUnderScoreJoin(
                        term.replace('$', '\\$')
                            .replace(' ', wordSep, 'gim')
                    )
                    + ')' + boundary, 'gim');
                try {
                    regexp.exec('X');
                } catch (err) {
                    console.log("Can't search " + term);
                    console.log(err);
                    return null;
                }
                return regexp;
            }

            var matches = [[], []];
            var pattern = buildMatcher(d.term);
            if (pattern !== null) {
                for (var i in fullData.docs.texts) {
                    var numericLabel = 1 * (fullData.docs.categories[fullData.docs.labels[i]] != fullData.info.category_internal_name);
                    var text = removeUnderScoreJoin(fullData.docs.texts[i]);
                    //var pattern = new RegExp("\\b(" + stripNonWordChars(d.term) + ")\\b", "gim");
                    var match;
                    var sentenceOffsets = null;
                    var lastSentenceStart = null;
                    var matchFound = false;
                    var curMatch = {'id': i, 'snippets': []};
                    if (fullData.docs.meta) {
                        curMatch['meta'] = fullData.docs.meta[i];
                    }
                    while ((match = pattern.exec(text)) != null) {
                        if (sentenceOffsets == null) {
                            sentenceOffsets = getSentenceBoundaries(text);
                        }
                        var foundSnippet = getMatchingSnippet(text, sentenceOffsets,
                            match.index, pattern.lastIndex);
                        if (foundSnippet.sentenceStart == lastSentenceStart) continue; // ensure we don't duplicate sentences
                        lastSentenceStart = foundSnippet.sentenceStart;
                        curMatch.snippets.push(foundSnippet.snippet);
                        matchFound = true;
                    }
                    if (matchFound) {
                        if (useFullDoc) {
                            curMatch.snippets = [
                                text
                                    .replace(/\n$/g, '\n\n')
                                    .replace(
                                        //new RegExp("\\b(" + d.term.replace(" ", "[^\\w]+") + ")\\b",
                                        //    'gim'),
                                        pattern,
                                        '<b>$&</b>')
                            ];
                        }
                        matches[numericLabel].push(curMatch);
                    }
                }
            }
            return {'contexts': matches, 'info': d};
        }

                        var temp = d3.select(divId)

            function getFrequencyDescription(name, count25k, count) {

                        return true;
                    })
                    .map(function (x) {return x.join(', ')}).join('<br>');
                */

            d3.select('#cathead')

            d3.select('#notcathead')

            if (jump) {

            function euclideanDistanceSort(a, b) {
                var aCatDist = a.x * a.x + (1 - a.y) * (1 - a.y);
                var aNotCatDist = a.y * a.y + (1 - a.x) * (1 - a.x);
                var bCatDist = b.x * b.x + (1 - b.y) * (1 - b.y);
                var bNotCatDist = b.y * b.y + (1 - b.x) * (1 - b.x);
                return (Math.min(aCatDist, aNotCatDist) > Math.min(bCatDist, bNotCatDist)) * 2 - 1;
            }

            function euclideanDistanceSortForCategory(a, b) {
                var aCatDist = a.x * a.x + (1 - a.y) * (1 - a.y);
                var bCatDist = b.x * b.x + (1 - b.y) * (1 - b.y);
                return (aCatDist > bCatDist) * 2 - 1;
            }

            function euclideanDistanceSortForNotCategory(a, b) {
                var aNotCatDist = a.y * a.y + (1 - a.x) * (1 - a.x);
                var bNotCatDist = b.y * b.y + (1 - b.x) * (1 - b.x);
                return (aNotCatDist > bNotCatDist) * 2 - 1;
            }

                var aNotCatDist = a.y * a.y + (1 - a.x) * (1 - a.x);
                var bNotCatDist = b.y * b.y + (1 - b.x) * (1 - b.x);
                var aGood = aCatDist < aNotCatDist;
                var bGood = bCatDist < bNotCatDist;
                return {aGood: aGood, bGood: bGood};
            }

            function scoreSortForCategory(a, b) {
                var __ret = arePointsPredictiveOfDifferentCategories(a, b);
                if (sortByDist) {
                    var aGood = __ret.aGood;

                    if (aGood && !bGood) return -1;

                return b.s - a.s;

                    var aGood = __ret.aGood;
                    var bGood = __ret.bGood;
                    if (aGood && !bGood) return 1;

                if (reverseSortScoresForNotCategory)

\u0430\u0446\u0438\u0438 \u041a\u0440\u044b\u043c\u0430 \u0440\u0435\u0448\u0435\u043d\u044b, \u0445\u043e\u0442\u044f \u043f\u0440\u043e\u0431\u043b\u0435\u043c \u0445\u0432\u0430\u0442\u0430\u0435\u0442", "\u041f\u0443\u0442\u0438\u043d \u0440\u0430\u0441\u0441\u043a\u0430\u0437\u0430\u043b, \u043a\u043e\u0433\u0434\u0430 \u0432 \u041a\u0440\u044b\u043c\u0443 \u0440\u0435\u0448\u0430\u0442 \u043f\u0440\u043e\u0431\u043b\u0435\u043c\u0443 \u0441 \u043f\u0440\u0435\u0441\u043d\u043e\u0439 \u0432\u043e\u0434\u043e\u0439", "\u0412 \u043e\u0442\u0432\u0435\u0442 \u043d\u0430 \u0437\u0430\u043f\u0430\u0434\u043d\u044b\u0435 \u0441\u0430\u043d\u043a\u0446\u0438\u0438 \u0440\u0443\u0441\u0441\u043a\u0438\u0435 \u043f\u0435\u0440\u0435\u0441\u0442\u0430\u043b\u0438 \u0443\u043c\u0438\u0440\u0430\u0442\u044c", "\"\u0420\u0435\u0430\u043a\u0446\u0438\u044f \u0412\u0435\u043d\u0433\u0440\u0438\u0438 \u043d\u0430 \u0441\u044e\u0436\u0435\u0442 \u041a\u0438\u0441\u0435\u043b\u0435\u0432\u0430 \u044d\u0442\u043e \u043d\u0435 \u0443\u0433\u0440\u043e\u0437\u0430 \u0420\u043e\u0441\u0441\u0438\u0438\"", "\u0421\u0430\u043d\u043a\u0446\u0438\u0438 \u043f\u0440\u043e\u0442\u0438\u0432 \u0420\u043e\u0441\u0441\u0438\u0438 - \u043e\u0442\u0440\u0435\u0437\u0432\u043b\u0435\u043d\u0438\u0435 \u0431\u043b\u0438\u0437\u043a\u043e?", "\"\u0421\u043e\u0431\u0440\u0430\u043b \u043d\u0430\u0433\u043b\u043e\u0441\u0442\u044c \u0432 \u043a\u0443\u043b\u0430\u043a \u0438 \u043d\u0430\u0437\u0432\u0430\u043b\u0441\u044f \u043f\u0438\u0441\u0430\u0442\u0435\u043b\u0435\u043c\"", "\u041f\u0443\u0442\u0438\u043d \u043e \u0431\u043b\u043e\u043a\u0430\u0434\u0435 \u041a\u0440\u044b\u043c\u0430: \"\u0414\u0443\u043c\u0430\u043b\u0438, \u043d\u0430 \u043a\u043e\u043b\u0435\u043d\u0438 \u0432\u0441\u0442\u0430\u043d\u0435\u043c? \u0423\u0434\u0438\u0432\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0435 \u0438\u0434\u0438\u043e\u0442\u044b...\"", "\u041f\u043e\u0435\u0437\u0434 \u0421\u0430\u043f\u0441\u0430\u043d \u0437\u0430\u0434\u0435\u0440\u0436\u0430\u043b\u0441\u044f \u0432 \u043f\u0443\u0442\u0438 \u0438\u0437-\u0437\u0430 \u043f\u043e\u0433\u043e\u0434\u043d\u044b\u0445 \u0443\u0441\u043b\u043e\u0432\u0438\u0439", "\u0420\u043e\u0441\u0441\u0438\u044f \u043f\u0435\u0440\u0435\u0434\u0430\u043b\u0430 \u041d\u0438\u0434\u0435\u0440\u043b\u0430\u043d\u0434\u0430\u043c \u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b\u044b \u043f\u043e \u043a\u0440\u0443\u0448\u0435\u043d\u0438\u044e Boeing \u043d\u0430 \u0423\u043a\u0440\u0430\u0438\u043d\u0435", "\u0412 \u0420\u043e\u0441\u0441\u0438\u0438 \u043c\u043e\u0433\u0443\u0442 \u0432\u0432\u0435\u0441\u0442\u0438 \u043d\u0430\u043b\u043e\u0433 \u043d\u0430 \u0434\u0435\u043f\u043e\u0437\u0438\u0442\u044b?", "\u0412 \u0418\u0442\u0430\u043b\u0438\u0438 \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u043e \u0434\u0432\u0430 \u0437\u0435\u043c\u043b\u0435\u0442\u0440\u044f\u0441\u0435\u043d\u0438\u044f \u043f\u043e\u0434\u0440\u044f\u0434", "\u041e\u0431\u0441\u0442\u0440\u0435\u043b \u0448\u043a\u043e\u043b\u044b \u0432 \u0421\u0438\u0440\u0438\u0438: \u043f\u043e\u0433\u0438\u0431\u043b\u0438 22 \u0440\u0435\u0431\u0435\u043d\u043a\u0430 \u0438 6 \u0443\u0447\u0438\u0442\u0435\u043b\u0435\u0439", "Socialismo ou Barb\u00e1rie", "\u041c\u043e\u0441\u043a\u0432\u0430 \u0432\u0432\u0435\u043b\u0430 \u0432 \u044d\u043a\u0441\u043f\u043b\u0443\u0430\u0442\u0430\u0446\u0438\u044e \u0441\u0438\u0441\u0442\u0435\u043c\u0443 \u043f\u043e \u0431\u043e\u0440\u044c\u0431\u0435 \u0441 \u043f\u0440\u0435\u0432\u044b\u0448\u0435\u043d\u0438\u0435\u043c \u0441\u043a\u043e\u0440\u043e\u0441\u0442\u0438", "\u041d\u0430\u0431\u043b\u044e\u0434\u0430\u0442\u0435\u043b\u0438 \u041e\u0411\u0421\u0415 \u0432\u044b\u044f\u0432\u0438\u043b\u0438 \u0440\u044f\u0434 \u043d\u0430\u0440\u0443\u0448\u0435\u043d\u0438\u0439 \u043f\u0440\u0438 \u043f\u043e\u0434\u0433\u043e\u0442\u043e\u0432\u043a\u0435 \u043a \u0432\u044b\u0431\u043e\u0440\u0430\u043c \u0432 \u0421\u0428\u0410", "\u0414\u0436\u043e\u043d \u041a\u0435\u0440\u0440\u0438: \u0410\u043d\u0442\u0438\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u0435 \u0441\u0430\u043d\u043a\u0446\u0438\u0438 \u0442\u043e\u043b\u044c\u043a\u043e \u0443\u043a\u0440\u0435\u043f\u0438\u043b\u0438 \u0421\u0428\u0410 \u0438 \u0415\u0432\u0440\u043e\u043f\u0443", "\u042e\u043d\u044b\u0439 \u0436\u0438\u0442\u0435\u043b\u044c \u0421\u0442\u0435\u0440\u043b\u0438\u0442\u0430\u043c\u0430\u043a\u0430 \u0441\u043f\u0430\u0441 \u0436\u0438\u0437\u043d\u044c \u0432\u044b\u043f\u0430\u0432\u0448\u0435\u0439 \u0438\u0437 \u043e\u043a\u043d\u0430 \u0434\u0435\u0432\u043e\u0447\u043a\u0435", "\u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440 \u0417\u0435\u043b\u044c\u0434\u0438\u043d \u0433\u043e\u0441\u043f\u0438\u0442\u0430\u043b\u0438\u0437\u0438\u0440\u043e\u0432\u0430\u043d \u0432 \u0442\u044f\u0436\u0435\u043b\u043e\u043c \u0441\u043e\u0441\u0442\u043e\u044f\u043d\u0438\u0438", "\u041c\u0438\u043d\u043e\u0431\u043e\u0440\u043e\u043d\u044b \u0420\u043e\u0441\u0441\u0438\u0438: \u042d\u0432\u0430\u043a\u0443\u0430\u0446\u0438\u044f \u0436\u0438\u0442\u0435\u043b\u0435\u0439 \u0410\u043b\u0435\u043f\u043f\u043e \u0431\u044b\u043b\u0430 \u0441\u043e\u0440\u0432\u0430\u043d\u0430 \u0431\u043e\u0435\u0432\u0438\u043a\u0430\u043c\u0438", "\u0422\u0438\u0433\u0440, \u0443\u0431\u0438\u0432\u0448\u0438\u0439 \u043a\u043e\u0440\u043e\u0432\u0443 \u0443 \u0444\u0435\u0440\u043c\u0435\u0440\u0430, \u043f\u043e\u0439\u043c\u0430\u043d \u043f\u043e\u0434 \u0412\u043b\u0430\u0434\u0438\u0432\u043e\u0441\u0442\u043e\u043a\u043e\u043c", "\u0428\u043a\u043e\u043b\u044b \u0432 \u0425\u0430\u0431\u0430\u0440\u043e\u0432\u0441\u043a\u0435 \"\u0437\u0430\u043c\u0438\u043d\u0438\u0440\u043e\u0432\u0430\u043b\" \u043f\u0435\u0440\u0432\u043e\u043a\u043b\u0430\u0441\u0441\u043d\u0438\u043a", "\u042d\u043a\u043e\u043b\u043e\u0433\u0438: \u0427\u0438\u0441\u043b\u043e \u043f\u043e\u0437\u0432\u043e\u043d\u043e\u0447\u043d\u044b\u0445 \u043d\u0430 \u043f\u043b\u0430\u043d\u0435\u0442\u0435 \u0441 1970 \u0433\u043e\u0434\u0430 \u0443\u043c\u0435\u043d\u044c\u0448\u0438\u043b\u043e\u0441\u044c \u0431\u043e\u043b\u0435\u0435 \u0447\u0435\u043c \u0432 \u0434\u0432\u0430 \u0440\u0430\u0437\u0430", "\u0424\u043b\u0435\u0448\u043a\u0438 \u0431\u0443\u0434\u0443\u0449\u0435\u0433\u043e: \u0423\u0447\u0435\u043d\u044b\u0435 \u043e\u0431\u044a\u044f\u0432\u0438\u043b\u0438 \u0430\u043b\u043c\u0430\u0437\u044b \u043b\u0443\u0447\u0448\u0438\u043c \u043d\u043e\u0441\u0438\u0442\u0435\u043b\u0435\u043c \u0438\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0438\u0438", "\u0412 \u0414\u0435\u043d\u044c \u043d\u0430\u0440\u043e\u0434\u043d\u043e\u0433\u043e \u0435\u0434\u0438\u043d\u0441\u0442\u0432\u0430 \u0432 \u041c\u043e\u0441\u043a\u0432\u0435 \u043f\u0440\u043e\u0439\u0434\u0435\u0442 \u043c\u0430\u0441\u0441\u043e\u0432\u0435 \u0448\u0435\u0441\u0442\u0432\u0438\u0435", "\u0412 \u0427\u0435\u0440\u043d\u043e\u043c \u043c\u043e\u0440\u0435 \u043d\u0430\u0448\u043b\u0438 \u043e\u0431\u043b\u043e\u043c\u043a\u0438 \u0431\u043e\u043b\u0435\u0435 40 \u0437\u0430\u0442\u043e\u043d\u0443\u0432\u0448\u0438\u0445 \u043a\u043e\u0440\u0430\u0431\u043b\u0435\u0439", "\u0414\u0432\u0435 \u0446\u0438\u0432\u0438\u043b\u0438\u0437\u0430\u0446\u0438\u0438: \u0411\u043e\u0440\u044c\u0431\u0430 \u043d\u0435 \u043d\u0430 \u0436\u0438\u0437\u043d\u044c, \u0430 \u043d\u0430 \u0441\u043c\u0435\u0440\u0442\u044c?", "57-\u043e\u0439 \u0433\u0443\u043c\u043a\u043e\u043d\u0432\u043e\u0439 \u0434\u043e\u0441\u0442\u0430\u0432\u0438\u043b \u0435\u0434\u0443 \u0438 \u043c\u0435\u0434\u0438\u043a\u0430\u043c\u0435\u043d\u0442\u044b \u0432 \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438 \u0414\u043e\u043d\u0431\u0430\u0441\u0441\u0430", "\"\u0427\u0435\u043c \u0431\u043b\u0438\u0436\u0435 \u043c\u044b \u043a \u0432\u0437\u044f\u0442\u0438\u044e \u0410\u043b\u0435\u043f\u043f\u043e, \u0442\u0435\u043c \u044f\u0440\u043e\u0441\u0442\u043d\u0435\u0435 \u0420\u043e\u0441\u0441\u0438\u044e \u0431\u0443\u0434\u0443\u0442 \u043e\u0431\u0432\u0438\u043d\u044f\u0442\u044c\"", "\u041f\u0443\u0442\u0438\u043d \u0440\u0430\u0441\u0441\u043a\u0430\u0437\u0430\u043b \u043b\u0438\u043f\u0435\u0446\u043a\u043e\u0439 \u0444\u0430\u0431\u0440\u0438\u043a\u0435 \u041f\u043e\u0440\u043e\u0448\u0435\u043d\u043a\u043e", "\u041c\u0438\u043d\u043e\u0431\u043e\u0440\u043e\u043d\u044b \u0420\u0424: \u0412\u0438\u0434\u0435\u043e\u043a\u0430\u0434\u0440\u044b \u043f\u043e\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u0439 \u0443\u0434\u0430\u0440\u0430 \u043f\u043e \u0448\u043a\u043e\u043b\u0435 \u0432 \u0418\u0434\u043b\u0438\u0431\u0435 - \u043c\u043e\u043d\u0442\u0430\u0436", "\u0412\u0430\u0448\u0438\u043d\u0433\u0442\u043e\u043d \u043d\u0435 \u0432\u044b\u043f\u043e\u043b\u043d\u044f\u0435\u0442 \u0441\u0432\u043e\u0438\u0445 \u043e\u0431\u044f\u0437\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432 \u043f\u043e \u0431\u043e\u0440\u044c\u0431\u0435 \u0441 \"\u0414\u0436\u0435\u0431\u0445\u0430\u0442 \u0430\u043d-\u041d\u0443\u0441\u0440\u0430\"", "\u041f\u0443\u0442\u0438\u043d \u0432\u044b\u0441\u043a\u0430\u0437\u0430\u043b \u0432\u0441\u0435, \u0447\u0442\u043e \u043e\u043d \u0434\u0443\u043c\u0430\u0435\u0442 \u043e \u0422\u0440\u0430\u043c\u043f\u0435", "\u0423\u0447\u0435\u043d\u044b\u0435 \u0441\u0434\u0435\u043b\u0430\u043b\u0438 \u0430\u043a\u043a\u0443\u043c\u0443\u043b\u044f\u0442\u043e\u0440 \u043d\u043e\u0432\u043e\u0433\u043e \u043f\u043e\u043a\u043e\u043b\u0435\u043d\u0438\u044f \u043f\u043e\u0445\u043e\u0436\u0438\u043c \u043d\u0430 \u043a\u0438\u0448\u0435\u0447\u043d\u0438\u043a", "\u041a\u0443\u0440\u0434\u044b \u0440\u0430\u0437\u0440\u0443\u0431\u044f\u0442 \u0431\u043b\u0438\u0436\u043d\u0435\u0432\u043e\u0441\u0442\u043e\u0447\u043d\u044b\u0439 \u0443\u0437\u0435\u043b", "\u041f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 \u041f\u0443\u0442\u0438\u043d \u043e\u0442\u0432\u0435\u0442\u0438\u043b \u043d\u0430 \u043a\u0440\u0438\u0442\u0438\u043a\u0443 \u0417\u0430\u043f\u0430\u0434\u0430 \u043f\u043e \u043f\u043e\u0432\u043e\u0434\u0443 \u0410\u043b\u0435\u043f\u043f\u043e", "\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u0439 \u0431\u0438\u043e\u043b\u043e\u0433 \u0441\u0442\u0430\u043b \u043f\u043e\u0431\u0435\u0434\u0438\u0442\u0435\u043b\u0435\u043c \u043a\u043e\u043d\u043a\u0443\u0440\u0441\u0430 Science, \"\u0441\u0442\u0430\u043d\u0446\u0435\u0432\u0430\u0432 \u0441\u0432\u043e\u044e \u0434\u0438\u0441\u0441\u0435\u0440\u0442\u0430\u0446\u0438\u044e\"", "\u0412\u044b\u043a\u0438\u043d\u0443\u0442\u044c \u0445\u043b\u0430\u043c \u0438 \u0436\u0438\u0442\u044c \u043f\u043e \u0444\u044d\u043d\u0448\u0443\u0439", "\u0414\u044b\u0440\u043a\u0430 \u043e\u0442 \u0440\u0443\u0431\u043b\u0438\u043a\u0430: \u0423\u043a\u0440\u0430\u0438\u043d\u0430 \u043d\u0435 \u043f\u043e\u043b\u0443\u0447\u0438\u0442 \u0448\u0442\u0440\u0430\u0444\u044b \u0441 \u0430\u0432\u0438\u0430\u043a\u043e\u043c\u043f\u0430\u043d\u0438\u0439 \u0420\u0424 \u0437\u0430 \u043f\u043e\u043b\u0435\u0442\u044b \u0432 \u041a\u0440\u044b\u043c", "\u0412 \u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u0431\u0443\u0440\u0433\u0435 \u043a\u043e\u043b\u043b\u0435\u043a\u0442\u043e\u0440\u044b \u0438\u0437\u0431\u0438\u043b\u0438 \u043f\u0435\u043d\u0441\u0438\u043e\u043d\u0435\u0440\u043a\u0443", "\u041f\u0443\u0442\u0438\u043d: \u0417\u0430\u043f\u0430\u0434 \u043f\u043e\u0441\u0442\u043e\u044f\u043d\u043d\u043e \u043d\u0430\u0441\u0442\u0443\u043f\u0430\u0435\u0442 \u043d\u0430 \u043e\u0434\u043d\u0438 \u0438 \u0442\u0435 \u0436\u0435 \u0433\u0440\u0430\u0431\u043b\u0438", "\u041c\u043e\u0441\u043a\u0432\u0430 \u0438 \u041c\u0430\u0434\u0440\u0438\u0434 \u0438\u0433\u0440\u0430\u044e\u0442 \u0441 \u041d\u0410\u0422\u041e \u0432 \u043d\u0435\u043f\u043e\u043d\u044f\u0442\u043a\u0438", "\u041a\u043e\u043c\u043f\u043b\u0435\u043a\u0441 \u041d\u043e\u0432\u043e\u0434\u0435\u0432\u0438\u0447\u044c\u0435\u0433\u043e \u043c\u043e\u043d\u0430\u0441\u0442\u044b\u0440\u044f \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e \u043e\u0431\u043d\u043e\u0432\u044f\u0442 \u043a 2023 \u0433\u043e\u0434\u0443", "\u0417\u0430\u0447\u0435\u043c \u0443\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u043e\u043c\u0443 \u043e\u043b\u0438\u0433\u0430\u0440\u0445\u0443 \u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0435 \u0433\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u0442\u0432\u043e?", "\u041f\u0443\u0442\u0438\u043d: \"\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0443\u0433\u0440\u043e\u0437\u0430\" - \u0433\u043b\u0443\u043f\u043e\u0441\u0442\u044c \u0438 \u0432\u044b\u043c\u044b\u0441\u0435\u043b", "\u041f\u0443\u0442\u0438\u043d: \u041d\u0435 \u0434\u0443\u043c\u0430\u044e, \u0447\u0442\u043e \u0430\u0433\u0440\u0435\u0441\u0441\u0438\u0432\u043d\u043e\u0441\u0442\u044c - \u043c\u043e\u0439 \u0441\u0442\u0438\u043b\u044c", "\u0412 \u043c\u0430\u0448\u0438\u043d\u0435 \u043f\u0440\u0435\u0434\u043f\u043e\u043b\u0430\u0433\u0430\u0435\u043c\u044b\u0445 \u0443\u0431\u0438\u0439\u0446 \u041d\u0435\u043c\u0446\u043e\u0432\u0430 \u043e\u0431\u043d\u0430\u0440\u0443\u0436\u0435\u043d\u044b \u0431\u0438\u043e\u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b\u044b", "\u0420\u043e\u0441\u0441\u0438\u044f \u0434\u043e\u043a\u0430\u0436\u0435\u0442 \u0432 \u041e\u041e\u041d, \u0447\u0442\u043e \u0434\u043e\u0433\u043e\u0432\u043e\u0440 \u043f\u043e \u0421\u0438\u0440\u0438\u0438 \u043d\u0435 \u0432\u044b\u043f\u043e\u043b\u043d\u044f\u044e\u0442 \u0421\u0428\u0410", "\u0412 \u041c\u0412\u0414 \u043e\u043f\u0440\u043e\u0432\u0435\u0440\u0433\u043b\u0438, \u0447\u0442\u043e \u0440\u0430\u0437\u044b\u0441\u043a\u0438\u0432\u0430\u044e\u0442 13-\u043b\u0435\u0442\u043d\u044e\u044e \u0434\u043e\u0447\u044c \u0421\u0435\u0440\u0434\u044e\u043a\u043e\u0432\u0430", "\u041a\u0430\u043d\u0430\u0434\u0430 \u0438 \u0415\u0421 \u043f\u043e\u0434\u043f\u0438\u0448\u0443\u0442 \u0441\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u0435 \u043e \u0441\u0432\u043e\u0431\u043e\u0434\u043d\u043e\u0439 \u0442\u043e\u0440\u0433\u043e\u0432\u043b\u0435", "\u041b\u0438\u0434\u0435\u0440 \u0438\u0440\u0430\u043a\u0441\u043a\u0438\u0445 \u043a\u0443\u0440\u0434\u043e\u0432 \u0440\u0430\u0441\u0441\u043a\u0430\u0437\u0430\u043b \u043e \u0441\u0440\u043e\u043a\u0430\u0445 \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u0438 \u0432 \u041c\u043e\u0441\u0443\u043b\u0435", "Apple \u0432\u044b\u043f\u0443\u0441\u0442\u0438\u0442 \u0442\u0440\u0438 \u0441\u0442\u0435\u043a\u043b\u044f\u043d\u043d\u044b\u0445 \"\u0430\u0439\u0444\u043e\u043d\u0430\"", "\u0421\u0428\u0410 \u043e\u0431\u0432\u0438\u043d\u0438\u043b\u0438 \u041a\u0438\u0442\u0430\u0439 \u0432 \u043a\u0440\u0430\u0436\u0435 \u0432\u043e\u0435\u043d\u043d\u044b\u0445 \u0441\u0435\u043a\u0440\u0435\u0442\u043e\u0432", "\u041a\u043e\u043c\u043f\u0430\u043d\u0438\u044f Alibaba \u043e\u0442\u043a\u0440\u044b\u043b\u0430 \u0432\u0430\u043a\u0430\u043d\u0441\u0438\u044e \u043a\u043e\u0442\u0430", "\u041f\u0440\u0438\u043c\u043e\u0440\u0441\u043a\u0438\u0435 \u0422\u041e\u0420 \u043c\u043e\u0433\u0443\u0442 \u043f\u043e\u043b\u0443\u0447\u0438\u0442\u044c 260 \u043c\u043b\u0440\u0434 \u0440\u0443\u0431. \u0438\u043d\u0432\u0435\u0441\u0442\u0438\u0446\u0438\u0439", "\u0421\u041c\u0418 \u0421\u0435\u0440\u0431\u0438\u0438 \u043f\u0440\u0438\u043f\u0438\u0441\u0430\u043b\u0438 \u0440\u043e\u0441\u0441\u0438\u044f\u043d\u0430\u043c \"\u043f\u043e\u0434\u0433\u043e\u0442\u043e\u0432\u043a\u0443 \u0442\u0435\u0440\u0430\u043a\u0442\u043e\u0432\" \u0432 \u0427\u0435\u0440\u043d\u043e\u0433\u043e\u0440\u0438\u0438", "\u0427\u0443\u0440\u043a\u0438\u043d: \u0421\u0428\u0410 \u043d\u0435 \u0432\u0437\u0430\u0438\u043c\u043e\u0434\u0435\u0439\u0441\u0442\u0432\u0443\u044e\u0442 \u0441 \u0420\u043e\u0441\u0441\u0438\u0435\u0439 \u0432 \u0431\u043e\u0440\u044c\u0431\u0435 \u0441 \"\u0414\u0436\u0435\u0431\u0445\u0430\u0442 \u0430\u043d-\u041d\u0443\u0441\u0440\u043e\u0439\"", "\u0421\u0435\u0440\u0431\u0441\u043a\u0430\u044f \u0433\u0430\u0437\u0435\u0442\u0430 \u0432\u044b\u0441\u043c\u0435\u044f\u043b\u0430 \u0443\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u043e\u0433\u043e \u043f\u043e\u0441\u043b\u0430-\u0433\u0440\u0430\u0444\u043e\u043c\u0430\u043d\u0430", "\u0412 \u0434\u0443\u0445\u0435 \u0432\u0440\u0435\u043c\u0435\u043d\u0438: \u041a\u0438\u0442\u0430\u0439 \u043e\u0431\u0437\u0430\u0432\u0435\u043b\u0441\u044f \u0432\u0442\u043e\u0440\u044b\u043c \u0430\u0432\u0438\u0430\u043d\u043e\u0441\u0446\u0435\u043c", "\u0427\u0438\u043d\u043e\u0432\u043d\u0438\u043a\u0438 \u043f\u0440\u0435\u0434\u043b\u0430\u0433\u0430\u044e\u0442 \u0432\u0432\u0435\u0441\u0442\u0438 \u0432 \u0420\u043e\u0441\u0441\u0438\u0438 \u043f\u043e\u0441\u043e\u0431\u0438\u0435 \u043f\u043e \u0431\u0435\u0434\u043d\u043e\u0441\u0442\u0438. \u0410 \u0434\u0440\u0443\u0433\u0438\u0435 - \u0443\u0431\u0440\u0430\u0442\u044c?", "\u0412 \u0420\u043e\u0441\u0441\u0438\u0438 \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0443\u0441\u043f\u0435\u0448\u043d\u043e \u0438\u0441\u043f\u044b\u0442\u0430\u043b\u0438 \u0433\u0438\u043f\u0435\u0440\u0437\u0432\u0443\u043a\u043e\u0432\u0443\u044e \u0440\u0430\u043a\u0435\u0442\u0443", "\u041f\u0440\u043e\u0432\u0430\u043b \u0437\u0430 \u043f\u0440\u043e\u0432\u0430\u043b\u043e\u043c: \u0412 \u0421\u0428\u0410 \u043f\u043e\u0445\u0438\u0442\u0438\u043b\u0438 \u0441\u043f\u0438\u0441\u043a\u0438 \u0448\u043f\u0438\u043e\u043d\u043e\u0432-\u043d\u0435\u043b\u0435\u0433\u0430\u043b\u043e\u0432", "\u0415\u0421 \u043d\u0430\u043c\u0435\u0440\u0435\u043d \u0440\u0430\u0441\u0448\u0438\u0440\u0438\u0442\u044c \u0441\u0430\u043d\u043a\u0446\u0438\u0438 \u0432 \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u0438 \u0421\u0438\u0440\u0438\u0438", "\u0410\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u043a\u0430, \u0437\u0430\u0431\u043e\u043b\u0435\u0432\u0448\u0430\u044f \u0440\u0430\u043a\u043e\u043c \u043e\u0442 \u043f\u0440\u0438\u0441\u044b\u043f\u043a\u0438 Johnson & Johnson, \u043e\u0442\u0441\u0443\u0434\u0438\u043b\u0430 $70 \u043c\u043b\u043d", "\"\u0414\u043b\u044f \u041f\u043e\u0440\u043e\u0448\u0435\u043d\u043a\u043e \u0433\u043b\u0430\u0432\u043d\u044b\u0435 \u0432\u0435\u0442\u0435\u0440\u0430\u043d\u044b \u0432\u043e\u0439\u043d\u044b \u2014 \u0431\u0430\u043d\u0434\u0435\u0440\u043e\u0432\u0446\u044b\"", "\"\u0413\u0440\u0430\u0436\u0434\u0430\u043d\u0430\u043c \u043c\u0438\u0440\u0430\" \u043d\u0443\u0436\u043d\u043e \u043d\u0435 \u041e\u0442\u0435\u0447\u0435\u0441\u0442\u0432\u043e, \u0430 \u0441\u043e\u0431\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0435 \u0441\u043f\u043e\u043a\u043e\u0439\u0441\u0442\u0432\u0438\u0435\"", "\u0421\u043e\u0440\u0430\u0442\u043d\u0438\u043a \u041f\u043e\u0440\u043e\u0448\u0435\u043d\u043a\u043e \u0432 \u0420\u0430\u0434\u0435 \u0437\u0430\u0434\u0435\u043a\u043b\u0430\u0440\u0438\u0440\u043e\u0432\u0430\u043b \u0445\u0440\u0430\u043c", "\u041a\u0430\u043a \u0437\u0430\u0442\u043a\u043d\u0443\u0442\u044c \"\u0447\u0435\u0440\u043d\u044b\u0435 \u0434\u044b\u0440\u044b\" \u0431\u044e\u0434\u0436\u0435\u0442\u043e\u0432", "\u0422\u0435\u043b\u0435\u043c\u0435\u0434\u0438\u0446\u0438\u043d\u0430 \u2014 \u043b\u0435\u0447\u0435\u0431\u043d\u044b\u0439 \u043f\u0440\u043e\u0440\u044b\u0432 \u0438\u043b\u0438 \u0444\u0438\u043a\u0446\u0438\u044f?", "\u0423\u043a\u0440\u0430\u0438\u043d\u0430 \u043f\u0443\u0433\u0430\u0435\u0442 \u0415\u0432\u0440\u043e\u043f\u0443 \"\u043f\u0440\u0438\u0437\u0440\u0430\u043a\u043e\u043c \u0420\u043e\u0441\u0441\u0438\u0438\"", "\u0410\u043a\u0430\u0434\u0435\u043c\u0438\u043a \u041c\u0430\u0442\u0438\u0448\u043e\u0432: \u0412 \u0410\u0440\u043a\u0442\u0438\u043a\u0435 \u043d\u0435 \u043c\u043e\u0436\u0435\u0442 \u0431\u044b\u0442\u044c \u0433\u0440\u0430\u043d\u0438\u0446", "\u0423\u0447\u0435\u043d\u044b\u0435 \u043f\u0440\u0438\u0431\u043b\u0438\u0437\u0438\u043b\u0438\u0441\u044c \u043a \u0440\u0430\u0437\u0433\u0430\u0434\u043a\u0435 \u0442\u0430\u0439\u043d\u044b \"\u0432\u0435\u0447\u043d\u043e\u0439 \u043c\u043e\u043b\u043e\u0434\u043e\u0441\u0442\u0438\"", "\u041e\u043f\u0440\u043e\u0441: \u0420\u043e\u0441\u0441\u0438\u044f\u043d\u0435 \u043e\u0434\u043e\u0431\u0440\u044f\u044e\u0442 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0430 \u041f\u0443\u0442\u0438\u043d\u0430 \u0438 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430", "\u041e\u0442\u043a\u0443\u0434\u0430 \u0432 \u0427\u0435\u0440\u043d\u043e\u0433\u043e\u0440\u0438\u0438 \u0438 \u0421\u0435\u0440\u0431\u0438\u0438 \u0432\u0437\u044f\u043b\u0438\u0441\u044c \"\u0440\u0443\u0441\u0441\u043a\u0438\u0435 \u0430\u0433\u0435\u043d\u0442\u044b\"", "\u0414\u043e\u0447\u044c \u0421\u0435\u0440\u0434\u044e\u043a\u043e\u0432\u0430 \u043e\u0431\u044a\u044f\u0441\u043d\u0438\u043b\u0430 \u0441\u0432\u043e\u0435 \u0438\u0441\u0447\u0435\u0437\u043d\u043e\u0432\u0435\u043d\u0438\u0435", "\u0420\u043e\u0441\u0441\u0438\u044f \u043d\u0435 \u043f\u0443\u0441\u0442\u0438\u043b\u0430 \u0412\u0412\u0421 \u0422\u0443\u0440\u0446\u0438\u0438 \u0432 \u0432\u043e\u0437\u0434\u0443\u0448\u043d\u043e\u0435 \u043f\u0440\u043e\u0441\u0442\u0440\u0430\u043d\u0441\u0442\u0432\u043e \u0421\u0438\u0440\u0438\u0438", "\u0422\u0435\u0440\u043f\u0435\u043d\u0438\u0435 \u043a\u043e\u043d\u0447\u0438\u0442\u0441\u044f: \u0420\u043e\u0441\u0441\u0438\u044f \u043e\u0442\u0432\u0435\u0442\u0438\u0442 \u043d\u0430 \u043f\u0440\u043e\u0432\u043e\u043a\u0430\u0446\u0438\u0438 \u0421\u0428\u0410", "\"\u0412 \"\u0433\u0438\u043f\u0435\u0440\u0437\u0432\u0443\u043a\u0435\" \u0420\u043e\u0441\u0441\u0438\u044f \u043d\u0430 \u043f\u0435\u0440\u0435\u0434\u043e\u0432\u044b\u0445 \u043f\u043e\u0437\u0438\u0446\u0438\u044f\u0445, \u0443 \u0421\u0428\u0410 \u0442\u0430\u043a\u043e\u0433\u043e \u043f\u043e\u043a\u0430 \u043d\u0435\u0442\"", "\u0423\u0447\u0435\u043d\u044b\u0435 \u043f\u043e\u0434\u0433\u043e\u0442\u043e\u0432\u0438\u043b\u0438 \u043a \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0441\u0442\u0432\u0443 100-\u043f\u0440\u043e\u0446\u0435\u043d\u0442\u043d\u044b\u0439 \u043c\u0443\u0436\u0441\u043a\u043e\u0439 \u043a\u043e\u043d\u0442\u0440\u0430\u0446\u0435\u043f\u0442\u0438\u0432", "\u0414\u0435\u043b\u043e \u043a \u0432\u043e\u0439\u043d\u0435: \u0426\u0435\u0440\u043a\u0432\u0438 \u0438\u0449\u0443\u0442 \u043e\u0431\u0449\u0438\u0439 \u044f\u0437\u044b\u043a", "\u0413\u043b\u0430\u0432\u0430 \u0412\u0410\u041a \u043f\u0440\u0438\u0437\u0432\u0430\u043b \u0443\u043c\u0435\u0440\u0438\u0442\u044c \u043f\u044b\u043b \u0432\u043e\u043a\u0440\u0443\u0433 \u0434\u0438\u0441\u0441\u0435\u0440\u0442\u0430\u0446\u0438\u0438 \u041c\u0435\u0434\u0438\u043d\u0441\u043a\u043e\u0433\u043e", "\u041a\u0430\u043a \u0437\u0430\u0441\u0442\u0430\u0432\u0438\u0442\u044c \u0441\u0435\u0431\u044f \u0437\u0430\u043d\u0438\u043c\u0430\u0442\u044c\u0441\u044f \u0441\u043f\u043e\u0440\u0442\u043e\u043c? \u041e\u0442\u0432\u0435\u0442 \u043d\u0430\u0439\u0434\u0435\u043d", "\u0420\u043e\u0441\u043a\u043e\u0441\u043c\u043e\u0441 \u043f\u0440\u0438\u0433\u0440\u043e\u0437\u0438\u043b \u043f\u0440\u0435\u043a\u0440\u0430\u0442\u0438\u0442\u044c \u043f\u043e\u0441\u0442\u0430\u0432\u043a\u0438 \"\u0421\u043e\u044e\u0437\u043e\u0432\" \u0432\u043e \u0424\u0440\u0430\u043d\u0446\u0438\u044e", "\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0435 \u043f\u043e\u0441\u043e\u043b\u044c\u0441\u0442\u0432\u043e \u0432 \u0414\u0430\u043c\u0430\u0441\u043a\u0435 \u0441\u043d\u043e\u0432\u0430 \u043f\u043e\u0434\u0432\u0435\u0440\u0433\u043b\u043e\u0441\u044c \u043c\u0438\u043d\u043e\u043c\u0435\u0442\u043d\u043e\u043c\u0443 \u043e\u0431\u0441\u0442\u0440\u0435\u043b\u0443", "\u0421\u0442\u0430\u043b\u0430 \u0438\u043
